import React from "react";
import Cart from "../Cart/Cart";
import styles from"./Header.module.css";
export default function Header(){
    return (
        <div>
            <header className={styles.header}>
                <h1>ReactMeals</h1>
                <Cart></Cart>
            </header>
            <div className={styles["main-image"]}>
                <img src="./meals.jps"></img>
            </div>
        </div>
    );
}
